bled, this is only applied to the second level.\";'),('en','messages:apihelp-query+backlinks-param-limit','s:179:\"How many total pages to return. If <var>$1redirect</var> is enabled, the limit applies to each level separately (which means up to 2 * <var>$1limit</var> results may be returned).\";'),('en','messages:apihelp-query+backlinks-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+backlinks-param-pageid','s:67:\"Page ID to search. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-query+backlinks-param-redirect','s:106:\"If linking page is a redirect, find all pages that link to that redirect as well. Maximum limit is halved.\";'),('en','messages:apihelp-query+backlinks-param-title','s:66:\"Title to search. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-query+backlinks-summary','s:43:\"Find all pages that link to the given page.\";'),('en','messages:apihelp-query+blocks-example-simple','s:12:\"List blocks.\";'),('en','messages:apihelp-query+blocks-example-users','s:57:\"List blocks of users <kbd>Alice</kbd> and <kbd>Bob</kbd>.\";'),('en','messages:apihelp-query+blocks-param-end','s:37:\"The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+blocks-param-ids','s:37:\"List of block IDs to list (optional).\";'),('en','messages:apihelp-query+blocks-param-ip','s:192:\"Get all blocks applying to this IP address or CIDR range, including range blocks.\nCannot be used together with <var>$3users</var>. CIDR ranges broader than IPv4/$1 or IPv6/$2 are not accepted.\";'),('en','messages:apihelp-query+blocks-param-limit','s:37:\"The maximum number of blocks to list.\";'),('en','messages:apihelp-query+blocks-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+blocks-param-show','s:133:\"Show only items that meet these criteria.\nFor example, to see only indefinite blocks on IP addresses, set <kbd>$1show=ip|!temp</kbd>.\";'),('en','mes