\";'),('en','messages:apihelp-query+langbacklinks-param-lang','s:31:\"Language for the language link.\";'),('en','messages:apihelp-query+langbacklinks-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+langbacklinks-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+langbacklinks-param-title','s:54:\"Language link to search for. Must be used with $1lang.\";'),('en','messages:apihelp-query+langbacklinks-paramvalue-prop-lllang','s:44:\"Adds the language code of the language link.\";'),('en','messages:apihelp-query+langbacklinks-paramvalue-prop-lltitle','s:36:\"Adds the title of the language link.\";'),('en','messages:apihelp-query+langbacklinks-summary','s:52:\"Find all pages that link to the given language link.\";'),('en','messages:apihelp-query+langlinks-example-simple','s:59:\"Get interlanguage links from the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+langlinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+langlinks-param-inlanguagecode','s:43:\"Language code for localised language names.\";'),('en','messages:apihelp-query+langlinks-param-lang','s:51:\"Only return language links with this language code.\";'),('en','messages:apihelp-query+langlinks-param-limit','s:29:\"How many langlinks to return.\";'),('en','messages:apihelp-query+langlinks-param-prop','s:63:\"Which additional properties to get for each interlanguage link:\";'),('en','messages:apihelp-query+langlinks-param-title','s:56:\"Link to search for. Must be used with <var>$1lang</var>.\";'),('en','messages:apihelp-query+langlinks-param-url','s:68:\"Whether to get the full URL (cannot be used with <var>$1prop</var>).\";'),('en','messages:apihelp-query+langlinks-paramvalue-prop-autonym','s:30:\"Adds the native language name.\";'),('en','messages:apihelp-query+langlinks-paramvalue-prop-langname','s:104:\"Adds the localised language name (best effort). Use <var>$1inlanguagecode</var> to