atus','s:52:\"Only fetch the upload status for the given file key.\";'),('en','messages:apihelp-upload-param-chunk','s:15:\"Chunk contents.\";'),('en','messages:apihelp-upload-param-comment','s:103:\"Upload comment. Also used as the initial page text for new files if <var>$1text</var> is not specified.\";'),('en','messages:apihelp-upload-param-file','s:14:\"File contents.\";'),('en','messages:apihelp-upload-param-filekey','s:67:\"Key that identifies a previous upload that was stashed temporarily.\";'),('en','messages:apihelp-upload-param-filename','s:16:\"Target filename.\";'),('en','messages:apihelp-upload-param-filesize','s:26:\"Filesize of entire upload.\";'),('en','messages:apihelp-upload-param-ignorewarnings','s:20:\"Ignore any warnings.\";'),('en','messages:apihelp-upload-param-offset','s:25:\"Offset of chunk in bytes.\";'),('en','messages:apihelp-upload-param-sessionkey','s:57:\"Same as $1filekey, maintained for backward compatibility.\";'),('en','messages:apihelp-upload-param-stash','s:90:\"If set, the server will stash the file temporarily instead of adding it to the repository.\";'),('en','messages:apihelp-upload-param-tags','s:68:\"Change tags to apply to the upload log entry and file page revision.\";'),('en','messages:apihelp-upload-param-text','s:32:\"Initial page text for new files.\";'),('en','messages:apihelp-upload-param-url','s:27:\"URL to fetch the file from.\";'),('en','messages:apihelp-upload-param-watch','s:15:\"Watch the page.\";'),('en','messages:apihelp-upload-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-upload-summary','s:52:\"Upload a file, or get the status of pending uploads.\";'),('en','messages:apihelp-userrights-example-expiry','s:72:\"Add user <kbd>SometimeSysop</kbd> to group <kbd>sysop</kbd> for 1 month.\";'),('en','messages:apihelp-userrights-example-user','s:118:\"Add user <kbd>FooBot</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-userrights-example-userid','s:127:\"Add the user with ID <kbd>123</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-userrights-param-add','s:115:\"Add the user to these groups, or if they are already a member, update the expiry of their membership in that group.\";'),('en','messages:apihelp-userrights-param-expiry','s:360:\"Expiry timestamps. May be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). If only one timestamp is set, it will be used for all groups passed to the <var>$1add</var> parameter. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, or <kbd>never</kbd> for a never-expiring user group.\";'),('en','messages:apihelp-userrights-param-reason','s:22:\"Reason for the change.\";'),('en','messages:apihelp-userrights-param-remove','s:34:\"Remove the user from these groups.\";'),('en','messages:apihelp-userrights-param-tags','s:57:\"Change tags to apply to the entry in the user rights log.\";'),('en','messages:apihelp-userrights-param-user','s:10:\"User name.\";'),('en','messages:apihelp-userrights-param-userid','s:8:\"User ID.\";'),('en','messages:apihelp-userrights-summary','s:33:\"Change a user\'s group membership.\";'),('en','messages:apihelp-validatepassword-example-1','s:61:\"Validate the password <kbd>foobar</kbd> for the current user.\";'),('en','messages:apihelp-validatepassword-example-2','s:77:\"Validate the password <kbd>qwerty</kbd> for creating user <kbd>Example</kbd>.\";'),('en','messages:apihelp-validatepassword-extended-description','s:206:\"Validity is reported as <samp>Good</samp> if the password is acceptable, <samp>Change</samp> if the password may be used for login but must be changed, or <samp>Invalid</samp> if the password is not usable.\";'),('en','messages:apihelp-validatepasswo